import React from 'react';
import {
  AppBar,
  Box,
  Button,
  Container,
  IconButton,
  Stack,
  Toolbar,
  Typography,
} from '@mui/material';
import RocketLaunchIcon from '@mui/icons-material/RocketLaunch';
import { NavLink } from 'react-router-dom';
import {
  buttonHeaderStyles,
  headerAppBarStyles,
  headerCompanyNameStyles,
  headerToolbarBoxStyles,
  headerToolbarStyles,
  navLinkStyles,
} from './HeaderStyles.js';
import { useLocation } from 'react-router';

const Header = () => {
  const location = useLocation();
  return (
    <AppBar
      position={'static'}
      color={'transparent'}
      enableColorOnDark
      elevation={0}
      sx={headerAppBarStyles}
    >
      <Container maxWidth={'xl'}>
        <Toolbar sx={headerToolbarStyles}>
          <Box sx={headerToolbarBoxStyles}>
            <IconButton>
              <RocketLaunchIcon />
            </IconButton>
            <Typography
              variant='h6'
              noWrap
              component='a'
              href='/'
              sx={headerCompanyNameStyles}
            >
              ИНТЭКАРТ
            </Typography>
          </Box>
          <Stack
            spacing={{ xs: 6, sm: 8, md: 10, xl: 12 }}
            direction={'row'}
            alignItems={'center'}
            alignSelf={'center'}
          >
            <Typography textAlign='center'>
              <NavLink to={'/services'} style={navLinkStyles}>
                {'услуги'}
              </NavLink>
            </Typography>
            <Typography textAlign='center'>
              <NavLink to={'/projects'} style={navLinkStyles}>
                {'проекты'}
              </NavLink>
            </Typography>
            <Typography textAlign='center'>
              <NavLink to={'/about'} style={navLinkStyles}>
                {'о нас'}
              </NavLink>
            </Typography>
            <Typography textAlign='center'>
              <NavLink to={'/contacts'} style={navLinkStyles}>
                {'контакты'}
              </NavLink>
            </Typography>
          </Stack>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Header;
